import Link from "next/link";
import { Navbar } from "react-bootstrap";

const AppNavbar = () => {
  return (
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
  );
};

export default AppNavbar;
